    self.assertTrue( self.R32.isSetFast() == False )
    i = self.R32.setFast(False)
    self.assertTrue( i == libsbml.LIBSBML_UNEXPECTED_ATTRIBUTE )
    self.assertTrue( self.R32.getFast() == False )
    self.assertTrue( self.R32.isSetFast() == False )
    i = self.R32.unsetFast()
    self.assertTrue( i == libsbml.LIBSBML_UNEXPECTED_ATTRIBUTE )
    self.assertTrue( self.R32.getFast() == False )
    self.assertTrue( self.R32.isSetFast() == False )
